import React, { Component } from 'react';
import { Route } from 'react-router-dom';
import Login from '../pages/Login';
import Register from '../pages/Register';


class AppContainer extends Component {
    constructor(props) {
      super(props);}
      render(){
          return(
              <>
              <Route 
              path="/login"
              component={() =>{
                  return(
                      <Login/>
                  )
              }}
              />
              <Route 
              path="/register"
              component={() =>{
                  return(
                      <Register/>
                  )
              }}
              />
              <Route 
              path="/about-us"
              component={() =>{
                  return(
                      <Register/>
                  )
              }}
              />
              </>
          );
    }
}

export default AppContainer;
